INSERT INTO `comics` (`id`, `name`, `slug`, `status`, `deleted_at`, `created_at`, `updated_at`, `image`, `id_category`, `id_wordpress`, `id_wordpress_media`, `id_wordpress_tag`, `content`, `alternative`, `author`, `language`, `detail_status`, `genres`, `rating`, `views`) VALUES
(1, 'One Piece', 'one-piece', 1, NULL, '2020-06-19 01:26:49', '2020-07-04 00:05:55', 'one-piece.jpg', 1, 239, 270, '79,9,12,17,24,27,50,58,87', 'Gol D. Roger was known as the Pirate King, the strongest and most infamous being to have sailed the Grand Line. The capture and death of Roger by the World Government brought a change throughout the world. His last words before his death revealed the location of the greatest treasure in the world, One Piece. It was this revelation that brought about the Grand Age of Pirates, men who dreamed of finding One Piece (which promises an unlimited amount of riches and fame), and quite possibly the most coveted of titles for the person who found it, the title of the Pirate King.Enter Monkey D. Luffy, a 17-year-old boy who defies the standard definition of a pirate. Rather than the popular persona of a wicked, hardened, toothless pirate who ransacks villages for fun, Luffy’s reason for being a pirate is one of pure wonder; the thought of an exciting adventure and meeting new and intriguing people, along with finding One Piece. Following in the footsteps of his childhood hero, Luffy and his crew travel across the Grand Line, experiencing crazy adventures, unveiling dark mysteries and battling strong enemies, all in order to reach One Piece.', 'ワンピース ; 海贼王 ; 원피스 ; All\'Arrembaggio(Italian) ; Bir Parça (Turkish)', 'Oda eiichiro', 'English', 'Ongoing', 'Shounen,Action,Adventure,Comedy,Drama,Fantasy,Martial arts,Mystery,Supernatural', 4.94, '7.163.776 view'),
(2, 'Black Clover', 'black-clover', 1, NULL, '2020-06-19 01:26:49', '2020-07-03 22:03:11', 'black-clover.jpg', 1, 240, 271, '79,9,12,24,27', 'In the Clover Kingdom, magic is everything and the greatest sorcerers rule over all. Yet when Arata is born without any Magical Power, he is abandoned at a church orphanage and neglected by everyone around him.Now Arata must find his own way in a cruel world and give his all to become the most powerful sorcerer in the entire kingdom; the Wizard King!An all-time favorite young and magical fantasy drawn with a beautiful touch and moved by its passionate characters!', 'ブラッククローバー ; 黑色五叶草 ; Black Five Leaf Grass', 'Tabata yuuki', 'English', 'Ongoing', 'Shounen,Action,Adventure,Drama,Fantasy', 4.98, '4.029.966 view'),
(3, 'Kimetsu no Yaiba', 'kimetsu-no-yaiba', 1, NULL, '2020-06-19 01:27:39', '2020-07-04 00:00:20', 'kimetsu-no-yaiba.jpg', 1, 241, 272, '79,9,12,27,38,87', 'Tanjiro is the eldest son in a family that has lost its father. Tanjiro visits another town one day to sell charcoal but ends up staying the night at someone else’s house instead of going home because of a rumor about a demon that stalks a nearby mountain at night. When he goes home the next day, tragedy is waiting for him.', 'Blade of Demon Destruction ; Demon Slayer Kimetsu no Yaiba ; Guardianes de la Noche ; Les Rodeurs de la nuit ; ดาบพิฆาตอสูร ; 鬼滅の刃 ; 鬼灭之刃 ; 귀멸의 칼날', 'Gotouge koyoharu', 'English', 'Ongoing', 'Shounen,Action,Adventure,Fantasy,Historical,Supernatural', 4.81, '8.077.440 view'),
(4, 'Boku no Hero Academia', 'boku-no-hero-academia', 1, NULL, '2020-06-19 01:27:39', '2020-07-04 00:01:21', 'boku-no-hero-academia.jpg', 1, 242, 273, '79,9,17,24,27,72,73', 'The story is set in the modern day, except people with special powers have become commonplace throughout the world. A boy named Izuku Midoriya has no powers, but he still dreams.Note: Nominated for the 8th Manga Taisho Award.', 'أكاديمية بطلي ; 僕のヒーローアカデミア ; 我的英雄学院 ; มายฮีโร่ อคาเดเมีย ; My Hero Academia', 'Horikoshi kouhei', 'English', 'Ongoing', 'Shounen,Action,Comedy,Drama,Fantasy,School life,Sci fi', 4.27, '5.517.386 view'),
(9, 'Dr. Stone', 'dr-stone', 1, NULL, '2020-06-28 20:29:42', '2020-07-03 22:03:12', 'dr-stone.jpg', 1, 243, 299, '79,9,17,58,67,73', 'Two friends find themselves in a post-apocalyptic world: most humans have been turned into stone.They will have to manage to survive and get a cure for this phenomenon!', 'ドクターストーン ; Dr.Stone', 'Inagaki riichiro', 'English', 'Ongoing', 'Shounen,Action,Comedy,Mystery,Psychological,Sci fi', 4.99, '2.500.259 view'),
(10, 'Apotheosis', 'apotheosis', 1, NULL, '2020-06-30 15:13:43', '2020-07-03 22:05:09', 'apotheosis.jpg', 2, 244, 274, '79,9,27,50', 'Apotheosis - elevation to the status of a god.Luo Zheng, now a humble slave was born as the eldest son of a wealthy family. Due to his family’s decline, the kidnapping of his sister by a powerful force, he can now only be stepped upon by others. However, heaven never seals off all exits. An ancient book left by his father reveals a secret divine technique, giving the reader immense power! But what is behind this power? This is a contest against fate.', '百炼成神 ; Bai Lian Cheng Shen', 'Ranzai studio', 'English', 'Ongoing', 'Shounen,Action,Fantasy,Martial arts', 4.43, '8.274.423 view'),
(11, 'Battle Through the Heavens', 'battle-through-the-heavens', 1, NULL, '2020-06-30 15:15:02', '2020-07-03 22:03:12', 'battle-through-the-heavens.jpg', 2, 245, 275, '79,9,12,17,70,87', 'In a land where no magic is present. A land where the strong makes the rules and weak has to obey. A land filled with alluring treasures and beauty yet also filled with unforeseen danger. Xiao Yan, who has shown talents none had seen in decades, suddenly three years ago lost everything, his powers, his reputation, and his promise to his mother. What sorcery has caused him to lose all of his powers? And why has his fiancee suddenly shown up?', '斗破蒼穹 ; Battle Through the Heavens ; Doupo Cangqiong ; Fights Break Sphere', '任翔 ; 蚕土豆', 'English', 'Ongoing', 'Shounen,Action,Adventure,Comedy,Romance,Supernatural', 4.78, '811 view'),
(12, 'Tales of Demons and Gods', 'tales-of-demons-and-gods', 1, NULL, '2020-06-30 15:15:13', '2020-07-03 22:05:09', 'tales-of-demons-and-gods.jpg', 2, 246, 297, '79,9,12,17,24,27,37,70', '【Genuine Authorization】（If the chapter is blocked, please download the newest version of app at http://www.mangazoneapp.com/ ）In his past life, although too weak to protect his home when it counted, out of grave determination Nie Li became the strongest Demon Spiritist and stood at the pinnacle of the martial world. However, he lost his life during the battle with the Sage Emperor and six deity-ranked beasts.His soul was then brought back to when he was still 13 years old. Although he’s the weakest in his class with the lowest talent, having only a red soul realm and a weak one at that, with the aid of the vast knowledge which he accumulated from his previous life, he decided to train faster than anyone could expect. He also decided to help those who died nobly in his previous life to train faster as well.He aims to protect the city from the coming future of being devastated by demon beasts and the previous fate of ending up destroyed. He aims to protect his lover, friends, family and fellow citizens who died in the beast assault or its aftermath. And he aims to destroy the so-called Sacred family who arrogantly abandoned their duty and betrayed the city in his past life.', '妖神记 ; 妖神记（全彩） ; Tale of Demons and Gods ; Yaoshenji ; Tales of Demons and Gods (Manhua) ; TDG ; Yāo Shén Jì ; Yêu Thần Ký ; Yao Shen Ji', 'Mad snail', 'English', 'Ongoing', 'Shounen,Action,Adventure,Comedy,Drama,Fantasy,Harem,Romance', 4.45, '17.979.577 view'),
(13, 'Star Martial God Technique', 'star-martial-god-technique', 1, NULL, '2020-06-30 15:15:26', '2020-07-03 22:03:12', 'star-martial-god-technique.jpg', 2, 247, 276, '79,9,12,24,27,50,70,72,87', '【Genuine Authorization】（If the chapter is blocked, please download the newest version of app at http://www.mangazoneapp.com/ ）In the whole world there lay twelve paths to climb the Tower of God, and in legends these twelve pathways lead towards the legendary road of immortality. However the paths in the Tower of God, are far too long, without end.In ancient times there once were many types of martial arts, sadly the world underwent terrible changes, and only three were left: Flame, Dragon and Star Martial Arts. Generations of experts of those three martial arts search for road of immortality.Accompany a Star Martial Arts practitioner on his lifetime journey, with young beauties at his side, and plans to become the Highest God.', '星武神诀 ; Xing Wu Shen Jue', 'Mad snail', 'English', 'Ongoing', 'Shounen,Action,Adventure,Drama,Fantasy,Martial arts,Romance,School life,Supernatural', 4.68, '8.624.367 view'),
(14, 'Versatile Mage', 'versatile-mage', 1, NULL, '2020-06-30 15:15:35', '2020-07-09 23:17:03', 'versatile-mage.jpg', 2, 248, 278, '9,12,24,27,50,72,94', 'He awoke, and the world was changed. The familiar high school now teaches magic, encouraging students to become the greatest magicians they can be. Beyond the city limits, wandering magical beasts prey on humans.An advanced scientific world changed into one with advanced magic. Yet, what has not changed was the same teacher who looks upon him with disdain, the same students who look upon him with contempt, the same father who struggles at the bottom rung of society, and the same innocent step sister who cannot walk.However, Mo Fan discovered that while everyone else can only use one major element, he himself can use all magic!', '全职法师 ; Quanzhi Fashi', 'Chaos ; 乱', 'English', 'Ongoing', 'Action,Adventure,Drama,Fantasy,Martial arts,School life,Tragedy', 3.33, '718.000 view'),
(15, 'Ranker Who Lives A Second Time', 'ranker-who-lives-a-second-time', 1, NULL, '2020-06-30 15:15:55', '2020-07-09 23:17:08', 'ranker-who-lives-a-second-time.jpg', 3, 249, 279, '9,12,27,101', 'Yeon-woo had a twin brother who disappeared five years ago. One day, a pocket watch left by his brother returned to his possession. Inside, he found a hidden diary in which was recorded “By the time you hear this, I guess I will be already dead….”', 'The Ranker Who Lives Twice ; 두 번 사는 랭커', 'Nong nong', 'English', 'Ongoing', 'Action,Adventure,Fantasy,Webtoon', 4.98, '2.143.063 view'),
(16, 'Tower of God', 'tower-of-god', 1, NULL, '2020-06-30 15:16:05', '2020-07-09 23:17:13', 'tower-of-god.jpg', 3, 250, 280, '79,9,12,17,24,27,58,67,70,87,101', 'What do you desire? Fortune? Glory? Power? Revenge? Or something that surpasses all others? Whatever you desire, ’that’ is here. Tower of God.', 'Башня Бога ; 神之塔 ; 신의 탑 ; Dievo Bokštas ; Shi-nui t\'ap ; Top of God ; Torre de Deus ; Torre de Dios', 'Siu', 'English', 'Ongoing', 'Shounen,Action,Adventure,Comedy,Drama,Fantasy,Mystery,Psychological,Romance,Supernatural,Webtoon', 4.24, '3.983.460 view'),
(17, 'The Legendary Moonlight Sculptor', 'the-legendary-moonlight-sculptor', 1, NULL, '2020-06-30 15:16:17', '2020-07-09 23:17:23', 'the-legendary-moonlight-sculptor.jpg', 3, 251, 281, '74,9,12,17,24,27,50,70,73,81,101', 'The man forsaken by the world, the man a slave to money and the man known as the legendary God of War in the highly popular MMORPG Continent of Magic. With the coming of age, he decides to say goodbye, but the feeble attempt to earn a little something for his time and effort ripples into an effect none could ever have imagined.Through a series of coincidences, his legendary avatar is sold for 3.1 billion won, bringing great joy to him, only to plunge him into despair at losing almost all of it to vicious loan sharks. With revelation of money through gaming, he rises from the abyss with new found resolve and steps forward into the new age of games led by the first ever Virtual Reality MMORPG, Royal Road.This is the legend of Lee Hyun on his path to becoming Emperor with only his family loving heart, his boundless desire for money, his unexpected mind, his diligently forged body and the talent of hard work backing him.', '달빛 조각사 ; Dalbic Jogaksa ; Legendary Moonlight Sculptor ; Royal Road ; Weed', 'Lee do-gyeong ; Nam heesung', 'English', 'Ongoing', 'Seinen,Action,Adventure,Comedy,Drama,Fantasy,Martial arts,Romance,Sci fi,Slice of life,Webtoon', 4.84, '2.474.950 view'),
(18, 'A Returner’s Magic Should Be Special', 'a-returners-magic-should-be-special', 1, NULL, '2020-06-30 15:16:46', '2020-07-09 23:17:30', 'a-returners-magic-should-be-special.jpg', 3, 252, 282, '79,9,12,17,27,50,72,81,87', '“Now that I’m back, I won’t allow my loved ones to die again!“The Shadow World - the most catastrophic existence humanity has faced in history.Desir Arman is one of the six remaining survivors of mankind within it.The six attempt to clear the final level of the labyrinth but ultimately fail, and the world comes to an end.However - when Desir thought he would meet his demise, what is revealed before him is the world... thirteen years ago?!Desir is returned to the past, back to the time when he enrolled at the nation’s finest magic academy - Havrion. He is reunited with his precious friends, and is prepared to change the past to save the world and his loved ones...!Three years remaining before the emergence of the Shadow World!Change the past and gather strong comrades to save mankind!', '귀환자의 마법은 특별해야 합니다', 'Jeon sun-wook', 'English', 'Ongoing', 'Shounen,Action,Adventure,Comedy,Fantasy,Martial arts,School life,Slice of life,Supernatural', 4.79, '20.000 view'),
(19, 'I Am the Sorcerer King', 'i-am-the-sorcerer-king', 1, NULL, '2020-06-30 15:16:59', '2020-07-09 23:17:41', 'i-am-the-sorcerer-king.jpg', 3, 253, 284, '79,9,12,27,101', '10 years ago, the monster horde from the rift formed from space and time started attacking the mankind. At the same time, people have started to awaken the power and began hunting the monsters for fame and money Lee SungHoon, in need of money because of his mother’s sickness, takes a dangerous job to help hunt those monsters four times a month by acting as a bait for the hunters But one day, he is heavily injured by a monster and remembers his past life as a sorcerer king ‘Huh? Did I just die?? ‘Wait, I was a Sorcerer King Kratraus in my previous life?’ With his past memories, SungHoon’s overpowered magic show begins', 'Naneun Madowangida ; 나는 마도왕이다', 'Decaspell', 'English', 'Ongoing', 'Shounen,Action,Adventure,Fantasy,Webtoon', 4.96, '5.255.000 view'),
(20, 'Yakusoku no Neverland', 'yakusoku-no-neverland', 1, NULL, '2020-07-02 03:08:17', '2020-07-13 07:30:40', 'yakusoku-no-neverland.jpg', 1, 375, 374, '79,39,58,67,87', 'Emma and her friends have a pretty good life at the orphanage they grew up in. Though the rules may be strict, the caretaker is kind. But why are the children forbidden from ever leaving...?', 'Miền đất hứa ; The Promised Neverland ; Обещанный Неверленд ; Якусоку но Нэбарандо ; نيفيرلاند الموعودة ; 約束のネバーランド ; 约定的梦幻岛 ; 약속의 네버랜드', 'Kaiu shirai', 'English', 'Ongoing', 'Shounen,Horror,Mystery,Psychological,Supernatural', 4.99, '4.713.000 view'),
(21, 'Haikyuu!!', 'haikyuu', 1, NULL, '2020-07-02 22:52:23', '2020-07-13 07:30:46', 'haikyuu.jpg', 1, 377, 376, '79,17,24,72,84', 'Ever since he saw the legendary player known as the \"Little Giant\" compete at the national volleyball finals, Shoyo Hinata has aimed to be the best volleyball player ever! He decides to join the team at the high school the Little Giant went to – and then surpass him. Who says you need to be tall to play volleyball when you can jump higher than anyone else?', 'ハイキュー!! ; 排球!! ; 排球少年!! ; ไฮคิว!! คู่ตบฟ้าประทาน ; Haikyuu!!', 'Furudate Haruichi', 'English', 'Ongoing', 'Shounen,Comedy,Drama,School life,Sports', 4.96, '6.834.000 view'),
(22, 'One Punch Man', 'one-punch-man', 1, NULL, '2020-07-02 22:52:29', '2020-07-13 07:30:59', 'one-punch-man.jpg', 1, 379, 378, '9,13,23,50,56,73,86,87', 'A fanmade comic by Cminglap, depicting Saitama vs a Godlike entity.WARNING: SPOILERS FOR THE ONE PUNCH MAN WEBCOMIC!Author/Artist: https://twitter.com/cminglap/media', '決戰神級外星人', 'Cminglap', 'English', 'Ongoing', 'Action,Aliens,Doujinshi,Martial arts,Monsters,Sci fi,Superhero,Supernatural', 4.84, '636 view'),
(23, 'Boruto', 'boruto', 1, NULL, '2020-07-02 22:52:34', '2020-07-13 07:31:05', 'boruto.jpg', 1, 381, 380, '79,9,12,17,24,27', 'Naruto was a young shinobi with an incorrigible knack for mischief. He achieved his dream to become the greatest ninja in the village and his face sits atop the Hokage monument. But this is not his story... A new generation of ninja are ready to take the stage, led by Naruto’s own son, Boruto!', 'Boruto Naruto Next Generation', 'Kishimoto masashi ; Ukyou kodachi', 'English', 'Ongoing', 'Shounen,Action,Adventure,Comedy,Drama,Fantasy', 4.95, '5.199.000 view'),
(24, 'Tensei shitara slime datta ken', 'tensei-shitara-slime-datta-ken', 1, NULL, '2020-07-02 22:53:17', '2020-07-13 07:33:26', 'tensei-shitara-slime-datta-ken.jpg', 1, 388, 382, NULL, NULL, NULL, NULL, 'English', NULL, NULL, 4.94, NULL),
(25, 'Domestic No Kanojo', 'domestic-no-kanojo', 1, NULL, '2020-07-02 22:53:23', '2020-07-13 07:33:33', 'domestic-no-kanojo.jpg', 1, 390, 389, '79,25,51,17,24,37,70,72', 'Tonight, Natsuo loses his virginity. His partner? Her name is Rui and he just met her today after school. She’s the one that brought up this whole situation, stating that she wanted to simply gain the knowledge about sex. She does not want to start a relationship, nor does she care about Natsuo.Afterwards, Natsuo feels guilty for losing his virginity to a girl he doesn’t even particularly like. Mostly, it makes him feel like he betrayed his crush to his high school teacher: Hina. A quirky love triangle story unfolds as Natsuo, Rui, and Hina all end up becoming part of the same family.', 'ドメスティックな彼女 ; 家有女友 ; 도메스틱한 그녀 ; Dome×Kano', 'Sasuga kei', 'English', 'Ongoing', 'Shounen,Ecchi,Mature,Comedy,Drama,Harem,Romance,School life', 4.74, '5.215.203 view'),
(26, 'Rebirth Of The Urban Immortal Cultivator', 'rebirth-of-the-urban-immortal-cultivator', 1, NULL, '2020-07-02 22:53:47', '2020-07-13 07:33:38', 'rebirth-of-the-urban-immortal-cultivator.jpg', 2, 392, 391, '74,9,12,27,50,81,87', NULL, NULL, 'Shili jianshen', NULL, 'Ongoing', 'Seinen,Action,Adventure,Fantasy,Martial arts,Slice of life,Supernatural', NULL, '5.252.000 view'),
(27, 'Spirit Sword Sovereign', 'spirit-sword-sovereign', 1, NULL, '2020-07-02 22:53:53', '2020-07-13 07:33:44', 'spirit-sword-sovereign.jpg', 2, 394, 393, '9,27,50', 'Once the spirit sword roars, within heaven, earth and the three worlds, I shall reign as the sovereign! Those who do not submit shall die!', 'Ling Jian Zun ; 灵剑尊', 'Iciyuan', 'English', 'Ongoing', 'Action,Fantasy,Martial arts', 4.86, '4.474.930 view'),
(28, 'Returning from the immortal world', 'returning-from-the-immortal-world', 1, NULL, '2020-07-02 22:54:01', '2020-07-13 07:33:49', 'returning-from-the-immortal-world.jpg', 2, 396, 395, '79,27,50,70', 'The fairy tales of the celestial world are flying in the soul, and the souls return to the original body on the earth. Tang Xiu was surprised to find that the celestial world had passed 10,000 years, and only one year passed on the earth.', 'Return of the World of the Celestials ; Returning from the Immortal World ; RFTIW ; Xian Jie Gui Lai ; 仙界归来', 'Mobius', 'English', 'Ongoing', 'Shounen,Fantasy,Martial arts,Romance', 4.33, '1.308.301 view'),
(29, 'My girlfriend is a zombie', 'my-girlfriend-is-a-zombie', 1, NULL, '2020-07-02 22:54:45', '2020-07-13 07:35:56', 'my-girlfriend-is-a-zombie.jpg', 2, 405, 404, '9,25,37,39,70,74', 'Faced with doomsday, the special power inside Ling Mo was woken up. He found out that he could control zombies. Therefore, he could walk through the zombie crowd safe and sound using his power, and eventually he met his beloved girlfriend — Ye Lian, but only to find out that she has already been transformed into a zombie. To help Ye retrieve her memories, Ling Mo started his survival in doomsday.', 'Virus Girlfriend,我的病毒女友', 'Manyu - China Reading - Dark Litchi', 'English', 'Ongoing', 'Action,Ecchi,Harem,Horror,Romance,Seine', 4.25, '953.901 view'),
(30, 'The superb captain in the city', 'the-superb-captain-in-the-city', 1, NULL, '2020-07-02 22:55:03', '2020-07-13 07:36:03', 'the-superb-captain-in-the-city.jpg', 2, 407, 406, '25,9,17', 'An extraordinarily charming and capable retired special forces who is pursued by enemies all over the world and targeted by evil powers. On top of these, he is also burdened with the mission of protecting his loved one. What kind of experience will this be?', '超级兵王在都市', 'Chaojineirong', 'English', 'Ongoing', 'Ecchi,Action,Comedy', 4.55, '1.380.650 view'),
(31, 'Release that witch', 'release-that-witch', 1, NULL, '2020-07-02 22:55:12', '2020-07-13 07:36:07', 'release-that-witch.jpg', 2, 409, 408, '12,24,27,37,87,101', 'A male engineer transmigrated into another world, and became a prince. This place strikingly resembles the Middle Ages of Europe, but at the same time, it seems kind of different? Witches truly exists, and they even possess magic powers! Magic powers are productive forces! Save the witches, liberate the productive forces! Open map, fight demons, break conspiracies, climb up the science and technology tree, and open the path of hardcore ‘farming’!', '放开那个女巫', 'Er mu', 'English', 'Ongoing', 'Adventure,Drama,Fantasy,Harem,Supernatural,Webtoon', 4.99, '4.819.000 view'),
(32, 'Martial Peak', 'martial-peak', 1, NULL, '2020-07-02 22:55:21', '2020-07-13 19:19:12', 'martial-peak.jpg', 2, 413, 437, '9,12,27,38,50', 'The journey to the martial peak is a lonely, solitary and long one.In the face of adversity,you must survive and remain unyielding.Only then can you break through and and continue on your journey to become the strongest. Sky Tower tests its disciples in the harshest ways to prepare them for this journey.One day the lowly sweeper Yang Kai managed to obtain a black book, setting him on the road to the peak of the martials world.', 'MP, 武炼巅峰', 'Momo (Ii)', 'English', 'Ongoing', 'Action,Adventure,Fantasy,Historical,Martial art', 4.52, '7.046.444 view'),
(33, 'My Wife Is A Demon Queen', 'my-wife-is-a-demon-queen', 1, NULL, '2020-07-02 22:55:31', '2020-07-13 19:19:13', 'my-wife-is-a-demon-queen.jpg', 2, 414, 438, '12,27,70,101', 'Listen up folks! I’m living my life with the demon queen!', '我老婆是魔王大人 ; Wo Laopo Shi Mowang Daren', 'Rong rong', 'English', 'Ongoing', 'Adventure,Fantasy,Romance,Webtoon', 4.71, '4.229.096 view'),
(34, 'Immortal Swordsman In The Reverse World', 'immortal-swordsman-in-the-reverse-world', 1, NULL, '2020-07-02 22:55:41', '2020-07-13 19:19:14', 'immortal-swordsman-in-the-reverse-world.jpg', 2, 415, 439, '25,9,12,27,37,50,70,87,101', 'Chu Qing is a sword expert cultivator, who 300 years ago accidentally entered the fairy world. During those 300 he began his cultivation journey. At the time of reaching the realm of eternity, it was not expected that he would instead open the hall of time and space and return to earth at the age of 17 years. But when he saw the situation, it turns out it was not the earth he once lived in, but the world was reversed between the roles of women and men. How was his journey to find a way to return to the original world, and defeat and conquer the strong women in the world ...', '本剑仙绝不吃软饭', '冬漫社', 'English', 'Ongoing', 'Ecchi,Action,Adventure,Fantasy,Harem,Martial arts,Romance,Supernatural,Webtoon', 4.86, '1.747.240 view'),
(35, 'God Of Martial Arts', 'god-of-martial-arts', 1, NULL, '2020-07-02 22:55:52', '2020-07-13 19:19:15', 'god-of-martial-arts.jpg', 2, 416, 440, '74,9,12,50', 'In this world, respect is earned with martial arts. Weak martial artists have strengths of tens of thousands of pounds, capable of cracking boulders. And the strong ones can cut off rivers and split mountains. There are even martial kings who know everything and can travel across the universe. Martial art decides your fate as well as your life and death. The weak is humiliated while the strong looks down on the world. This is a a world where the strong bullies the weak. People’s statuses are decided by the levels of their cultivation of martial arts. Each faction fights for the title of “The Strongest“. Only the strong ones have the right to survive. Even if you are from the same clan or faction, if you are weak, then you will be bullied and kicked out without mercy.', 'Peerless Martial God', 'Yunduowudongman [add]', 'English', 'Ongoing', 'Seinen,Action,Adventure,Martial arts', 4.32, '7.609.109 view'),
(36, 'I\'m The Great Immortal', 'im-the-great-immortal', 1, NULL, '2020-07-02 22:56:04', '2020-07-13 19:19:16', 'im-the-great-immortal.jpg', 2, 417, 441, '79,9,27,37,50,101', 'The previous life was a peerless genius in the world of immortality. He was killed by 3 celestial beings. He was accidentally reborn to his 20s by the book of heaven. All he wanted to do was to become an immortal and return to the immortal world, and he became the strongest man on the earth, turning his hands into clouds and covering his hands with rain, provoking anyone who defies him! He is the venerable one! the ruler of 3000 worlds! the guywho is 10 000 times better than Thanos! He is Taixuan Taizun! the Great Immortal!', 'I\'m Daxianzun ; 我是大仙尊', 'June snow studio', 'English', 'Ongoing', 'Shounen,Action,Fantasy,Harem,Martial arts,Webtoon', 4.04, '1.579.680 view'),
(37, 'Hero? I Quit A Long Time Ago', 'hero-i-quit-a-long-time-ago', 1, NULL, '2020-07-02 22:56:14', '2020-07-13 19:19:17', 'hero-i-quit-a-long-time-ago.jpg', 2, 424, 442, '9,27,73,79', 'Zero was mankind’s first real superhero. Under his watch, countless other superheros appeared and followed in his footsteps. However, after 5 years of war, Zero disappeared without a trace.', NULL, 'Novelist Sf - Wu Liao Kan Kan Tian - Hai Luo', 'English', 'Ongoing', 'Action,Fantasy,Sci fi,Shoune', 4.75, '3.200.548 view'),
(38, 'Peerless Battle Spirit', 'peerless-battle-spirit', 1, NULL, '2020-07-02 22:56:38', '2020-07-13 19:19:17', 'peerless-battle-spirit.jpg', 2, 425, 443, '9,12,27,50', 'In the Canglan Continent, only those that who manage to awaken a Martial Spirit can walk on the path of cultivation. In this world, only those with stronger martial spirits can communicate with the heavens and earth. Qin Nan, born in Linshui City, was a peerless genius who possessed talent and was thought to become a great cultivator in the future. However, things changed when he ended up awakening a grade 1 Martial Spirit, resulting in him being considered as trash.', 'Berserk Peerless Battle Spirit ; Berserk Sovereign of Battle ; 狂霸战皇', '立群君&神域动漫', 'English', 'Ongoing', 'Action,Adventure,Fantasy,Martial arts', 4.94, '382.261 view'),
(39, 'The strongest god king', 'the-strongest-god-king', 1, NULL, '2020-07-02 22:56:51', '2020-07-13 19:19:18', 'the-strongest-god-king.jpg', 2, 426, 445, '9,27,50,87,101', 'This is an era full of aura, and a world where the immortals gather. The young Wu Fu returned from a reunion,and looking at his eyes, how calm he was. What I need to do is to raise the sword and clear all the enemies of the last', 'The Strongest King ; The Strongest god ; 最强神王', 'Edge man cartoon', 'English', 'Ongoing', 'Action,Fantasy,Martial arts,Supernatural,Webtoon', 4.48, '2.305.000 view'),
(40, 'the mythical realm', 'the-mythical-realm', 1, NULL, '2020-07-02 22:57:00', '2020-07-13 19:19:19', 'the-mythical-realm.jpg', 2, 427, 447, '79,9,12,27', 'The Mythical Realm; A world of blood, a world where the strong triumph over the weak, Ye Yun descended to hell to slain hordes of Demons and ascend to Heaven to slain the Gods just to prove his existence as the strongest, a world where a single being can rule over Heaven and Earth.', 'Xianxia Shijie ; 仙侠世界', 'Wu zui', 'English', 'Ongoing', 'Shounen,Action,Adventure,Fantasy', 4.98, '3.298.294 view'),
(41, 'Metropolitan System', 'metropolitan-system', 1, NULL, '2020-07-02 22:57:08', '2020-07-13 19:19:20', 'metropolitan-system.jpg', 2, 428, 449, '79,12,37,50,87', 'Jiang Bai was killed in a truck accident when trying to escape from a high risk casino after winning a huge amountof money but instead of dying, his soul was transported into a parallel world that is similar to Earth and merge with his alternate pathetic self. Over there he met the mad god who grant him a powerful BUG ability in this new world. Jiang Bai is now stuck in his alternate world self, who is far weaker and less more influential than the original him. Can he make a comeback in this new parallel earth with his new cheat abilities?', '都市枭雄系统', 'Tu jun', 'English', 'Ongoing', 'Shounen,Adventure,Harem,Martial arts,Supernatural', 4.12, '3.254.786 view'),
(42, 'The Second Coming Of Gluttony', 'the-second-coming-of-gluttony', 1, NULL, '2020-07-02 22:57:28', '2020-07-13 19:19:29', 'the-second-coming-of-gluttony.jpg', 3, 429, 451, '51,9,12,24,27,50,67,101', 'He was an addict, a loser, a despicable human being. But, one fleeting dream that may not have been a dream at all reawakens his once-lost senses. Possessing a very unique ability, he would use that, and the dream, to forge his path in the world now known as the Lost Paradise.', 'The Second Coming of Avarice ; 탐식의 재림', 'Ro yu-jin', 'English', 'Ongoing', 'Mature,Action,Adventure,Drama,Fantasy,Martial arts,Psychological,Webtoon', 4.97, '3.365.000 view'),
(43, 'Tomb Raider King', 'tomb-raider-king', 1, NULL, '2020-07-02 22:57:38', '2020-07-13 19:19:30', 'tomb-raider-king.jpg', 3, 430, 453, '79,9,12,27,101', 'The God’s Tombs started to appear around the world. Due to the relics within these tombs, many were able to wield these legendary power for themselves, while others became enslaved to these users. However, a Tomb Raider appears with the purpose of robbing these relics. The Tomb Raider King. “God damn it! Did that bastard already loot this place as well?!” What you own belongs to me. What I own definitely belongs to me. This is the story of a revived Tomb Raider who will do whatever he can to claim all the tombs and relics for himself!', 'Tomb RaIder (Yoonz) ; 도굴왕', 'Yoonz', 'English', 'Ongoing', 'Shounen,Action,Adventure,Fantasy,Webtoon', 4.64, '771.937 view'),
(44, 'Overgeared', 'overgeared', 1, NULL, '2020-07-02 22:57:51', '2020-07-13 19:19:31', 'overgeared.jpg', 3, 431, 455, '9,12,27', 'Young Woo Shin, Username: Grid. In the words best virtual reality game , bad luck always revolves around him. But he stumbled across a job during a quest, the strongest legendary job out of over 2 billion players!', '템빨', 'Dong Wook Lee', 'English', 'Ongoing', 'Action,Adventure,Fantas', 4.97, '357.411 view'),
(45, 'Solo Leveling', 'solo-leveling', 1, NULL, '2020-07-02 22:58:00', '2020-07-13 19:19:32', 'solo-leveling.jpg', 3, 432, 457, '9,12,27,79,101', '10 years ago, after “the Gate” that connected the real world with the monster world opened, some of the ordinary, everyday people received the power to hunt monsters within the Gate. They are known as \"Hunters\". However, not all Hunters are powerful. My name is Sung Jin-Woo, an E-rank Hunter. I\'m someone who has to risk his life in the lowliest of dungeons, the \"World\'s Weakest\". Having no skills whatsoever to display, I barely earned the required money by fighting in low-leveled dungeons… at least until I found a hidden dungeon with the hardest difficulty within the D-rank dungeons! In the end, as I was accepting death, I suddenly received a strange power, a quest log that only I could see, a secret to leveling up that only I know about! If I trained in accordance with my quests and hunted monsters, my level would rise. Changing from the weakest Hunter to the strongest S-rank Hunter!', '나 혼자만 레벨업', 'Sung-Lak Jang', NULL, 'Ongoing', 'Action,Adventure,Fantasy,Shounen,Webtoon', NULL, '1.930.791 view'),
(46, 'The God Of High School', 'the-god-of-high-school', 1, NULL, '2020-07-02 22:58:08', '2020-07-13 19:32:14', 'the-god-of-high-school.jpg', 3, 482, 459, '79,9,12,17,50,87,101', 'While an island half-disappearing from the face of the earth, a mysterious organization is sending out invitations for a tournament to every skilled fighter in the world. “If you win you can have ANYTHING you want”They’re recruiting only the best to fight the best and claim the title of The God of high school!', '갓 오브 하이스쿨 ; The God of Highschool ; God of Highschool ; GoH ; 高校之神', 'Park yong-je', 'English', 'Ongoing', 'Shounen,Action,Adventure,Comedy,Martial arts,Supernatural,Webtoon', 4.88, '2.974.568 view'),
(47, 'a pervert\'s daily life', 'a-perverts-daily-life', 1, NULL, '2020-07-02 22:58:20', '2020-07-13 19:20:30', 'a-perverts-daily-life.jpg', 3, 462, 461, '17,24,25,70,49', NULL, NULL, 'Alice Crazy', 'English', 'Ongoing', 'Comedy,Drama,Ecchi,Romance,Manhw', 4.22, '336.088 view'),
(48, 'The Great Mage Returns After 4000 Years', 'the-great-mage-returns-after-4000-years', 1, NULL, '2020-07-02 22:58:28', '2020-07-13 19:20:37', 'the-great-mage-returns-after-4000-years.jpg', 3, 464, 463, '9,12,27', 'The worst student of Westrod Academy, the disgrace of the Blake House.', '4000년 만에 귀환한 대마도사', 'Barnacle', 'English', 'Ongoing', 'Action,Adventure,Fantas', 4.95, '251.091 view'),
(49, 'Who made me a princess', 'who-made-me-a-princess', 1, NULL, '2020-07-02 22:58:36', '2020-07-14 22:01:28', 'who-made-me-a-princess.jpg', 3, 466, 465, '17,27,70,49,40', 'The beautiful Athanasia was killed at the hands of her own biological father, Claude de Alger Obelia, the cold-blooded emperor! It’s just a silly bedtime story… until one woman wakes up to suddenly find she’s become that unfortunate princess! She needs a plan to survive her doomed fate, and time is running out. Will she go with Plan A, live as quietly as possible without being noticed by the infamous emperor? Plan B, collect enough money to escape the palace? Or will she be stuck with Plan C, sweet-talking her way into her father’s good graces?!', 'One day I became a princess, Suddenly Became a Princess One Day, 某天成为公主, 어느 날 공주가 되어버렸다', 'Plutos', 'English', 'Ongoing', 'Comedy,Fantasy,Romance,Manhwa,Iseka', 4.88, '798.814 view'),
(50, 'The villainess who reverse the hourglass', 'the-villainess-who-reverse-the-hourglass', 1, NULL, '2020-07-02 22:58:45', '2020-07-13 19:29:39', 'the-villainess-who-reverse-the-hourglass.jpg', 3, 468, 467, '27,29,45,70,101', 'With the marriage of her prostitute mother to the Count, Aria’s status in society skyrocketed immediately. After leading a life of luxury, Aria unfairly meets death because of her sister Mielle’s schemes. And right before she dies, she sees an hourglass fall as if it were a fantasy. And just like that, she was miraculously brought back to the past.“I want to become a very elegant person, just like my sister, Mielle.”In order to face the villainess, she must become an even more wicked villainess. This was the new path Aria chose to take revenge on Mielle who murdered both her and her mother.', 'The Villainess Turns the Hourglass ; 악녀는 모래시계를 되돌린다', '산소비', NULL, 'Ongoing', 'Fantasy,Full color,Long strip,Romance,Webtoon', NULL, '50 view'),
(51, 'Lady baby', 'lady-baby', 1, NULL, '2020-07-02 22:58:55', '2020-07-13 19:29:50', 'lady-baby.jpg', 3, 470, 469, '77,27,58,70,101', 'Calliope has suffered through nature’s law and many accidents. Her family was murdered and an ongoing war ended her life, but she traveled back in time to when she was born?! While Calliope slowly grows, will she be able to figure out who killed her family and stop them in time?', 'Leidi Beibi ; 레이디 베이비', 'Ju hyeon', 'English', 'Ongoing', 'Shoujo,Fantasy,Mystery,Romance,Webtoon', 4.85, '66.000 view'),
(52, 'The Gamer', 'the-gamer', 1, NULL, '2020-07-02 22:59:10', '2020-07-13 19:30:02', 'the-gamer.jpg', 3, 472, 471, '79,9,12,17,72,87,101', 'Han Jee-Han, a normal high school student, suddenly develops a special power where his entire world is shifted into a game-like setting. He can see the power levels of people, look at the stats of a seemingly normal item, get abilities, and even level up! Follow Han Jee-Han as he discovers how to use this power, and maybe even where it came from.What if your life is just like playing a game? What if you can upgrade your status and gain more levels? A fantasy world is coming right at you!', 'Геймер ; اللاعب ; 遊俠 ; 더 게이머 ; THE 게이머 ; Žaidėjas', 'Sung san-young', 'English', 'Ongoing', 'Shounen,Action,Adventure,Comedy,School life,Supernatural,Webtoon', 4.84, '3.682.395 view'),
(53, 'Tsugumomo', 'tsugumomo', 1, NULL, '2020-07-02 22:59:19', '2020-07-13 19:30:40', 'tsugumomo.jpg', 3, 474, 473, '74,11,25,51,9,17,37,70,87', 'Kazuya Kagami never goes anywhere without the precious Sakura Obi his mother gave him. One day a beautiful, kimono-clad girl named Kiriha appeared before him. Kiriha naturally began to live with Kazuya in his room. Then there’s Chisato, Kazuya’s childhood friend with glasses and a ponytail, who meddles in his affairs. Soon there’s also an overprotective older sister who seems to want to take baths with him. Jumble in a huge-chested priestess, a good-looking sorceress named Kokuyoura, beautiful women, and hot girls, and Kazuya’s happy, embarrassing, confusing life begins!', 'つぐもも ; 怪怪守护神 ; 破鞋神二世', 'Hamada yoshikazu', 'English', 'Ongoing', 'Seinen,Adult,Ecchi,Mature,Action,Comedy,Harem,Romance,Supernatural', 4.99, '5.027.000 view'),
(54, 'Jagaaaaaan', 'jagaaaaaan', 1, NULL, '2020-07-02 22:59:28', '2020-07-13 19:31:01', 'jagaaaaaan.jpg', 3, 476, 475, '74,51,9,17,24,39,58,87', 'Shintarou Jagasaki, who is a neighborhood police officer, lives with his girlfriend while working a job that is killing him slowly with annoyance. It looks like he will end up marrying soon and live a boring life with a nuclear family - a grim future for a guy with dreams! One such day, a mysterious monster appeared on the train and he suddenly can shoot with his right hand like Master Buppanatsu, the eggplant mascot of his city!', 'ジャガーン', 'Kaneshiro muneyuki', 'English', 'Ongoing', 'Seinen,Mature,Action,Comedy,Drama,Horror,Mystery,Supernatural', 4.86, '1.015.858 view'),
(55, 'Reborn 80,000 Years', 'reborn-80000-years', 1, NULL, '2020-07-02 22:59:35', '2020-07-13 19:31:09', 'reborn-80000-years.jpg', 3, 478, 477, '12,24,27,50,79,87,101', 'A generation of strong stars, Stardust, died at the hands of the villain and fell accidentally. When I woke up, I had been sleeping for 80,000 years. Things have changed. The four adopted sons have already become the strong men of the continent; a wild dog that has been saved has become the supreme demon king... that child, it is said 40,000 years ago, overcame common customs and became supreme! Observing the small sorrows of tens of thousands of years ago, one by one, Yang Chen feels that Yalishan is great! This is a little loaded.', '重生八万年,The star emperor', 'Burning Manhua - Zhang Yue', 'English', 'Ongoing', 'Adventure,Drama,Fantasy,Martial arts,Shounen,Supernatural,Webtoon', 4.99, '595.948 view'),
(56, 'Kingdom', 'kingdom', 1, NULL, '2020-07-02 22:59:46', '2020-07-13 19:31:34', 'kingdom.jpg', 3, 480, 479, '74,9,24,38', 'Millions of years have passed since the times of legends, when the worlds of men and gods were still the same. In these times it was the desires of man that moved the world. It is the era of the 500 year war: The warring states period. Kingdom is the story of a young boy named Xin who grew into a great general and all the trials and bloodshed that lead him there.', 'キングダム ; 王者天下', 'Hara yasuhisa', NULL, 'Ongoing', 'Seinen,Action,Drama,Historical', NULL, '5.124.172 view');
